    #region Body Map Front

    private void OnPaintSurface(object sender, SKPaintSurfaceEventArgs args)
    {
        SKSurface surface = args.Surface;
        SKImageInfo info = args.Info;
        SKCanvas canvas = surface.Canvas;
        canvas.Clear();

        SKRect bounds;
        BodyMapFrontFullPath.GetBounds(out bounds);
        BodyMapFrontScale = Math.Min(info.Width / bounds.Width, info.Height / bounds.Height);
        AddTranslateXToFront = info.Width / 2;
        AddTranslateYToFront = info.Height / 2;
        SubTranslateXToFront = -bounds.MidX;
        SubTranslateYToFront = -bounds.MidY;

        canvas.Translate(AddTranslateXToFront, AddTranslateYToFront);
        canvas.Scale(BodyMapFrontScale);
        canvas.Translate(SubTranslateXToFront, SubTranslateYToFront);

        GetSelectedParts();
        foreach (var part in BodyPartsFront)
        {
            part.Value.FillType = SKPathFillType.Winding;
            canvas.DrawPath(part.Value, SelectedBodyParts.Contains(part.Key) ? SelectionPaint : NonSelectionPaint);
        }
    }

    private void GetSelectedParts()
    {
        SelectedBodyParts = (vm.BodyMap != null && !string.IsNullOrEmpty(vm.BodyMap.Parts)) ?
            vm.BodyMap.Parts?.Split(',')?.Select(s => int.Parse(s))?.ToList()
            : SelectedBodyParts;
        IsNotesEnbled = (SelectedBodyParts?.Count() > 0) ? "True" : "False";
    }

    private void OnBodyPartSelection(object sender, SKTouchEventArgs e)
    {
        SKPoint point = e.Location;
        point = SKPoint.Subtract(point, new SKSize(AddTranslateXToFront, AddTranslateYToFront));
        point = SKPoint.Subtract(point, new SKSize(SubTranslateXToFront * BodyMapFrontScale, SubTranslateYToFront * BodyMapFrontScale));

        foreach (var part in BodyPartsFront)
            if (part.Value.Contains(point.X / BodyMapFrontScale, point.Y / BodyMapFrontScale))
            {
                if (!SelectedBodyParts.Contains(part.Key))
                    SelectedBodyParts.Add(part.Key);
                else SelectedBodyParts.Remove(part.Key);
                vm.BodyMapNotesPopupVm.Parts = String.Join(',', SelectedBodyParts?.ConvertAll<string>(delegate (int i) { return i.ToString(); })?.ToList());
                break;
            }
        canvasView.InvalidateSurface();
    }

    #endregion Body Map Front

    #region Body Map Rear

    private void OnPaintSurfaceRear(object sender, SKPaintSurfaceEventArgs args)
    {
        SKSurface surface = args.Surface;
        SKImageInfo info = args.Info;
        SKCanvas canvas = surface.Canvas;
        canvas.Clear();

        SKRect bounds;
        BodyMapRearFullPath.GetBounds(out bounds);
        BodyMapRearScale = Math.Min(info.Width / bounds.Width, info.Height / bounds.Height);
        AddTranslateXToRear = info.Width / 2;
        AddTranslateYToRear = info.Height / 2;
        SubTranslateXToRear = -bounds.MidX;
        SubTranslateYToRear = -bounds.MidY;

        canvas.Translate(AddTranslateXToRear, AddTranslateYToRear);
        canvas.Scale(BodyMapRearScale);
        canvas.Translate(SubTranslateXToRear, SubTranslateYToRear);
        GetSelectedParts();

        foreach (var part in BodyPartsRear)
        {
            part.Value.FillType = SKPathFillType.Winding;
            canvas.DrawPath(part.Value, SelectedBodyParts.Contains(part.Key) ? SelectionPaint : NonSelectionPaint);
        }
    }

    private void OnBodyPartSelectionRearAsync(object sender, SKTouchEventArgs e)
    {
        SKPoint point = e.Location;
        point = SKPoint.Subtract(point, new SKSize(AddTranslateXToRear, AddTranslateYToRear));
        point = SKPoint.Subtract(point, new SKSize(SubTranslateXToRear * BodyMapRearScale, SubTranslateYToRear * BodyMapRearScale));

        foreach (var part in BodyPartsRear)
            if (part.Value.Contains(point.X / BodyMapRearScale, point.Y / BodyMapRearScale))
            {
                if (!SelectedBodyParts.Contains(part.Key))
                    SelectedBodyParts.Add(part.Key);
                else SelectedBodyParts.Remove(part.Key);
                vm.BodyMapNotesPopupVm.Parts = String.Join(',', SelectedBodyParts?.ConvertAll<string>(delegate (int i) { return i.ToString(); })?.ToList());

                break;
            }

        canvasViewBack.InvalidateSurface();
    }

    #endregion Body Map Rear
